import React, { useState, useEffect } from 'react'

function App() {

  const [users, setUsers] = useState([])

  useEffect(() => {
   fetch('http://127.0.0.1:5000/user', {
      'method':'GET',
      headers: {
          'Contenty-Type':'application/json'
      }
   })
   .then(resp=> resp.json())
   .then(resp=> setUsers(resp))
   .catch(error => console.log(error))

  }, [])

  return (
      <div>
          <h1>Sign Up</h1>
          {users.map(user => {
            return (
              <div key = {user.id}>
                <h2>{user.password}</h2>


              </div>
            )
          })}

      </div>

  );
}

export default App
